<?php

namespace App;
use Illuminate\Database\Eloquent\Model;
use Illuminate\Support\Str;
use DB;

class Ubigeo extends Model
{
    protected 	$table 			=	'MaestroUbigeo';
    protected	$primaryKey		=	'id';
    public 		$incrementing   =   false;
    protected 	$keyType        =   'string';
    public $timestamps          =   false; 

    #1. Obtengo la relación de todos los registros
    public static function getData()
    {
        return Ubigeo::orderBy('id', 'asc')
                ->get();
    }

    #2. Obtengo la relacion de regiones
    public static function getRegiones()
    {
        return Ubigeo::where(DB::raw('LEN(id)'), '=', 2)
                ->orderBy('nombre', 'ASC')
                ->get();
    }

    #3. Obtengo la relación de provincias pertenecientes a una region
    public static function getProvincias($region)
    {
        return Ubigeo::where(DB::raw('LEN(id)'), '=', 4)
                ->where('id', 'like', $region.'%')
                ->orderBy('nombre', 'ASC')
                ->get();
    }

    #4. Obtengo la relación de distritos pertenecientes a una provincia
    public static function getDistritos($provincia)
    {
        return Ubigeo::where(DB::raw('LEN(id)'), '=', 6)
                ->where('id', 'like', $provincia.'%')
                ->orderBy('nombre', 'ASC')
                ->get();
    }

    #5. Obtengo la región del distrito a consultar
    public static function getRegion($distrito)
    {
        return Str::substr($distrito, 0, 2);
    }

    #6. Obtengo la provincia del distrito a consultar
    public static function getProvincia($distrito)
    {
        return Str::substr($distrito, 0, 4);
    }

